import React from "react";
import { faTools } from '@fortawesome/free-solid-svg-icons'

import Card from "../common/card";

import "./styles/skills.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const skills = () => {
	return (
		<div className="skills-container">
				<div className="skills-container-header">
					<div className="skills-container-icon">
						<FontAwesomeIcon icon={faTools} />
					</div>
					<div className="-title">Back End</div>
				</div>
					<div className="skills-container-body">
						<div className="skill">
							<img
								src="./facebook.png"
								alt="facebook"
								className="skill-image"
							/>
							<div className="skill-title">Airbus D&S</div>
						</div>

						<div className="skill">
							<img
								src="./twitter.png"
								alt="twitter"
								className="skill-image"
							/>
							<div className="skill-title">Twitter</div>
						</div>
					</div>
		</div>
	);
};

export default skills;
